BEGIN;
SELECT public.register_patch('20191122-migrate-old-conversion-factors.sql', 'eLCA');

CREATE TABLE elca.conversion_migrations (
    source              varchar(20)  NOT NULL,
    process_db_id       int          NOT NULL,
    conversion_id       int          NOT NULL,
    in_unit             varchar(10)  NOT NULL,
    out_unit            varchar(10)  NOT NULL,
    factor              numeric      NOT NULL,
    ident               varchar(20),
    created             timestamptz  NOT NULL,
    modified            timestamptz,
    process_config_id   int          NOT NULL,
    process_config_name varchar(250) NOT NULL,
    process_config_uuid uuid         NOT NULL,
    PRIMARY KEY ("source", "process_db_id", "conversion_id")
);




ALTER TABLE elca.process_conversion_versions ADD COLUMN "old_factor" numeric;

WITH db AS (
    SELECT 38 AS process_db_id,
        '20131210' AS source
),
    process_config_conversions AS (
        SELECT DISTINCT db.source, db.process_db_id, process_config_id, pc.uuid, c.id AS conversion_id, c.in_unit, c.out_unit,
            c.factor, c.ident, pc.name
        FROM elca.process_conversions_v c
                 JOIN elca.process_configs pc ON pc.id = c.process_config_id
                 JOIN db ON db.process_db_id = c.process_db_id
    ),
    old_conversions AS (
        SELECT m.process_db_id, m.process_config_uuid, m.in_unit, m.out_unit, p.process_config_id, p.conversion_id
                , m.factor AS old_factor
                , p.factor AS curr_factor
                , m.process_config_name AS old_name
                , p.name AS new_name
                , m.ident AS old_ident
                , p.ident AS new_ident
        FROM elca.conversion_migrations m
                 JOIN process_config_conversions p ON (p.process_db_id, p.uuid, p.in_unit, p.out_unit) = (m.process_db_id, m.process_config_uuid, m.in_unit, m.out_unit)
        WHERE m.source = p.source AND m.factor <> p.factor
    )
UPDATE elca.process_conversion_versions v
SET old_factor = x.curr_factor,
    factor = x.old_factor
FROM old_conversions x
WHERE (v.conversion_id, v.process_db_id) = (x.conversion_id, x.process_db_id);

